import NavBareElement from '../Sup Components/NavBareElement';
import Mainproduct from '../Components/mainproduct/Mainproduct';  
import "../Components/mainproduct/mainproduct.css"

function Userinterface() {
  
  return ( <div >
    <div >
   
    <NavBareElement/>
    </div>
    <div>
    <Tiitle/>
